import CodeInfo from "./CodeInfo/CodeInfo";

const CodeInfos = ({ data, active }) => {

  return (
    <div>
      {data.map((data) => (
        <CodeInfo key={data.id} id={data.id} des={data.description} code={data.code} active={active} />
      ))}
    </div>
  );
};

export default CodeInfos;
